import React, { useEffect, useState, useRef} from "react";
import { Message3 } from "./Message3";
import { CONSTANTS } from "../helpers/Constants";
import { Grid, Paper, IconButton, TextareaAutosize, Avatar } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import SendIcon from '@material-ui/icons/Send';
import MenuList from '@material-ui/core/MenuList';
import MenuItem from '@material-ui/core/MenuItem';
import Typography from '@material-ui/core/Typography';
import { deepOrange } from '@material-ui/core/colors';
// console.info('Include MessageField');

export const MessageField3 = () => {
    const textarea = useRef();

    const [objMessage, setObjMessage] = useState({
        myMessage: ""
    });

    const handleChangeMessage = (event) => {
        const value = event.target.value;
        setObjMessage({ myMessage: value });
    }

    const [send, setSend] = useState(false);
    const formSubmit = (event) => {
        event.preventDefault();
        setSend(true);
        setTimeout(() => setSend(false), 1000);
    }

    const [answer, setAnswer] = useState([
        {
            'author': '',
            'message': '',
            'date': '',
        }
    ]);

    useEffect(() => {
        textarea.current.focus();
      }, []);

    useEffect(() => {
        if (send == true && objMessage.myMessage != '') {
            setAnswer(
                [...answer, {
                    'author': CONSTANTS.author,
                    'message': objMessage.myMessage,
                    'date': new Date().toLocaleTimeString(),
                }]
            );
            setObjMessage({ myMessage: "" });
        }
    }, [send]);

    const useStyles = makeStyles((theme) => ({
        root: {
            flexGrow: 1,
        },
        paper: {
            padding: theme.spacing(2),
            textAlign: 'left',
            color: theme.palette.text.secondary,
        },
        input: {
            marginLeft: theme.spacing(1),
            flex: 1,
        },
        iconButton: {
            padding: 10,
        },
        form: {
            padding: '2px 4px',
            display: 'flex',
            alignItems: 'center',
        },
        orange: {
            color: theme.palette.getContrastText(deepOrange[500]),
            backgroundColor: deepOrange[500],
        },
        typography: {
            margin: '10px'
        }
    }));

    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Grid container spacing={3}>
                <Grid item xs={12}>
                    <Paper className={classes.paper}><h2>#Lesson 3 - Messenger - UI</h2></Paper>
                </Grid>
                <Grid item xs={3}>
                    <Paper className={classes.paper}>
                        <MenuList>
                            <MenuItem>
                                <Avatar alt="Jasica Alba" src="data:image/jpeg;base64," />
                                <Typography variant="inherit" className={classes.typography}>Jasica Alba</Typography>
                            </MenuItem>
                            <MenuItem>
                                <Avatar className={classes.orange}>H</Avatar>
                                <Typography variant="inherit" className={classes.typography}>Harrison Smith</Typography>
                            </MenuItem>
                            <MenuItem>
                                <Avatar alt="Emma Watson" src="data:image/jpeg;base64," />
                                <Typography variant="inherit" className={classes.typography}>Emma Watson</Typography>
                            </MenuItem>
                        </MenuList>
                    </Paper>
                </Grid>
                <Grid item xs={9}>
                    <Paper className={classes.paper}><Message3 answer={answer} send={send} /></Paper>
                    <Paper>
                        <form onSubmit={formSubmit} className={classes.form}>
                            <TextareaAutosize
                                className={classes.input}
                                rowsMax={4}
                                placeholder="Enter your message ..."
                                value={objMessage.myMessage}
                                onChange={handleChangeMessage}
                                ref={textarea}
                            />
                            <IconButton aria-label="send" className={classes.iconButton} color="primary" type="submit">
                                <SendIcon />
                            </IconButton>
                        </form>
                    </Paper>
                </Grid>
            </Grid>
        </div>
    )
}